import React, { useState, useEffect } from "react";
import "../css/signup.css";
import avatar from "../assets/logo.png";
import { Link } from "react-router-dom";
import { useLocation } from "react-router-dom";
import Swal from "sweetalert2";
function EnrollCourses() {
  const { search } = useLocation();
  const searchParams = new URLSearchParams(search);
  const email = searchParams.get("email");
  const [course, setCourse] = useState([]);
  const [selectedCourse, setSelectedCourse] = useState(""); // Added state for selected course
  const [courseInfo, setCourseInfo] = useState([]);
  const handleFormSubmit = (e) => {
    e.preventDefault();
  };
  useEffect(() => {
    fetch("https://sxt9335.uta.cloud/fetchCourseID.php")
      .then((response) => response.json())
      .then((data) => {
        setCourse(data);
      })
      .catch((error) => {
        alert(error);
        console.error("Error fetching data:", error);
      });
  }, []);

  const fetchCourseInfo = (courseId) => {
    fetch("https://sxt9335.uta.cloud/fetchCourses.php", {
      method: "POST",
      headers: {
        "Content-Type": "application/x-www-form-urlencoded",
      },
      body: `courseId=${courseId}`,
    })
      .then((response) => response.text())
      .then((data) => {
        setCourseInfo(data);
        alert(courseInfo);
      })
      .catch((error) => {
        console.error("Error:", error);
        Swal.fire(
          "Oops!",
          "An error occurred while fetching the user.",
          "error"
        ).then((result) => {
          if (result.isConfirmed) {
            window.location.href = `/student?email=${email}`;
          }
        });
      });
  };

  const handleCourseSelect = (e) => {
    const selectedCourseId = e.target.value;
    setSelectedCourse(selectedCourseId);
    fetchCourseInfo(selectedCourseId);
  };
  return (
    <div className="signbody">
      <header>
        <Link to="/home" data-after="About">
          <img className="signuplogo" src={avatar} alt="skillbridge" />
        </Link>
      </header>
      <div className="signlogin-wrapper">
        <form onSubmit={handleFormSubmit} method="POST" className="signform">
          <h3>Enroll into Courses</h3>
          <div className="signinput-group">
            <div className="signselect-container">
              <select
                name="course_id"
                id="courseSelect"
                onChange={handleCourseSelect}
              >
                <option value="">Select a course</option>
                {course.map((courses, index) => (
                  <option key={index} value={courses}>
                    {courses}
                  </option>
                ))}
              </select>

              <div className="signselect-arrow"></div>
            </div>
            <div className="signinput-group">
              <input
                type="text"
                name="course_id" // Set the name attribute to "lastname"
                id="loginUser"
                value={courseInfo.courseName}
                readOnly
                required
              />
              <label for="loginUser">Course Name</label>
            </div>
            <div className="signinput-group">
              <input
                type="text"
                name="course_id" // Set the name attribute to "lastname"
                id="loginUser"
                value={courseInfo.instructorName}
                readOnly
                required
              />
              <label for="loginUser">Instructor Name</label>
            </div>
            <div className="signinput-group">
              <input
                type="text"
                name="course_id" // Set the name attribute to "lastname"
                id="loginUser"
                value={courseInfo.coursePeriod}
                readOnly
                required
              />
              <label for="loginUser">Course Period</label>
            </div>
          </div>

          <input type="submit" value="Update" className="signsubmit-btn" />
          <Link to={`/student?email=${email}`} className="signforgot-pw">
            Go Back
          </Link>
        </form>
      </div>
    </div>
  );
}

export default EnrollCourses;
